import React from 'react';
import './App.css';
import Profile from './components/profile';
import Header from './components/header';
import Nav from './components/nav';



const App = () => {
  return (
    <div className="app-wrapper">
			<Header/>
			<Profile/>
			<Nav/>
			<header className="header">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjFMReJvcQ0Z1pD2h1FXmwqJT8BSii9W8FlQ&usqp=CAU" />
      </header>
        </div>

  );
}



export default App;
